import React from "react";
import { InputAdornment, withStyles, TextField } from "@material-ui/core";
import { Search } from "@material-ui/icons";
const styles = {};
const StyledSearchBar = withStyles({
  root: {
    color: "inherit",
  },
})(TextField);

export default function SearchBar() {
  return (
    <StyledSearchBar
      variant="outlined"
      placeholder="Search..."
      InputProps={{
        endAdornment: (
          <InputAdornment>
            <Search />
          </InputAdornment>
        ),
      }}
    />
  );
}
